jobs.description:
Потрібен майстер, зробити ремонт в декількох кімнатах: 
- шпаклювання;
- фарбування;
- покласти ламінат

Шукаю сантехніка !

Що потрібно зробити:
- підключення ванни до системи водопостачання та каналізації;
- установка та підключення змішувача до ванни;
- перевірка на витоки та правильну роботу системи.

Потрібна допомога у виконанні завдань з вищої математики!

Тема залікової роботи: "Диференціальні рівняння вищих порядків 
та їх застосування"

Тобто мені необхідно:
- огляд основних понять і методів розв'язання 
диференціальних рівнянь вищих порядків;
- розв'язання конкретних завдань на прикладах;
- аналіз результатів та їх інтерпретація;
- висновки та можливі рекомендації.

Потрібен спеціаліст для виконання такого преліку робіт:
- монтаж газового котла та радіаторів опалення;
- прокладання трубопроводів по всьому будинку для обігріву;
- установка терморегуляторів для контролю температури;
- перевірка та налаштування системи опалення.

Потрібен спеціаліст для 
- перевірки та заміни застарілих елементів 
системи (котел, трубопровід, радіатори тощо);
- можливе розширення системи 
опалення (додавання підігріву підлоги, радіаторів у нових приміщеннях);
- встановлення ефективної системи регулювання температури;
- перевірка та налаштування системи на оптимальну роботу.

Потрібно встановити нову ванну в санвузлі житлової квартири.
Розміри ванни: Стандартні розміри для ванни: довжина 150-170 см, 
ширина 70-80 см.
Тип ванни: Акрилова ванна з облицюванням плиткою.
Матеріали: Ванна, силіконовий герметик, плитка для облицювання.
Також потрібно:
- встановлення сталевої рамки для монтажу ванни;
- герметизація з'єднань і місць монтажу;
- забезпечення правильної вентиляції приміщення після монтажу;
- перевірка належного функціонування ванни після монтажу.

Потрібно здійснити ремонт каналізаційної системи у житловому будинку.

Проблеми -  засмічення, протікання труб, пошкодження стояків.

Потрібні роботи:
- перевірка та діагностика стану каналізаційних труб;
- прочищення та очищення каналізаційних труб від забруднень;
- заміна пошкоджених труб та фіксаторів;
- перевірка належного функціонування каналізаційної системи після ремонту.

Потрібно провести ремонт мережі водопостачання у житловому будинку.
Відбувся витік, пошкодження труб, недоліки у роботі кранів на  кухні.

Потрібні роботи:
- діагностика стану мережі водопостачання;
- знаходження та усунення місця витоку або пошкодження труб;
- заміна пошкоджених ділянок труб;
- перевірка належного функціонування всієї мережі після ремонту.

Потрібно замовити приготування пляцків для весілля.

Місце: Ресторан "Золотий Фазан"
Тип пляцків: Широкий асортимент, включаючи класичні українські, 
європейські та інші варіації.
Кількість гостей: Приблизно 100 осіб

Додаткові вимоги:
- рознообразні начинки та топінги;
- декорування пляцків відповідно до весільної тематики;
- забезпечення відповідної кількості пляцків для всіх гостей;
- подача пляцків на столи відразу після приготування.

Потрібно замовити коровай на весілля.
Розмір: Середній (для близько 50 осіб)

Особливості:
- класичний коровай із зернами пшениці та вишитий в українському стилі;
- прикраса символами весілля: обручки, квіти, голуби;
- подача короваю під час урочистого обряду весільної церемонії;
- можливість доставки короваю до ресторану.

Потрібно замовити страви на новорічний стіл для вечірки 
у компанії друзів та родичів.

Склад гостей: Приблизно 20 осіб (включаючи дорослих і дітей)

Бажані страви:
- холодні закуски: вареники з картоплею та грибами, 
салат "Олів'є", канапе з сьомгою;
- основні страви: м'ясна дошка (із свинини, яловичини та курки), 
гарячі пельмені, стейк з лосося;
- гарніри: маринована капуста, картопля по-селянськи, 
рис з овочами;
- десерти: тірамісу, фруктовий салат, шоколадний фонтан з фруктами;

Потрібно замовити приготування гарячих страв для вечірки у компанії друзів та родичів.
Місце: Приватний будинок
Кількість гостей: Приблизно 20 осіб
Бажані страви:
- грильоване м'ясо (стейки, шашлики) з гарнірами;
- рибні страви (лосось, кальмари) з овочами;
- паста та італійські страви;
- супи та перші страви;
- вегетаріанські страви для окремих гостей.

Прошу надати послуги бровіста вдому!

- потрібно скоригувати форму брів;
- фарбування брів;
- ламінування брів;

Потрібен архітектор для проектування:
- будиночку з металоконструкції площею в 70 - 80 кв м.;
- створення дизайну зовнішнього вигляду та планування 
внутрішнього простору будівлі.;

Хочу замовити архітектора для технічного керівництва та нагляду:
- супровід будівництва та виконання проекту від початку до завершення;
- контроль якості будівельних робіт та відповідність проекту.

Підготовка присадибної ділянки до сезону

- обрізка крон плодових дерев;
- хімічна прополка грунту від бур'янів;
- пересадка городніх і садових культур;
- внесення кореневих добрив

Потрібен флорист для оформлення святкових столів гостей !

Вимоги:
- використання невеликих круглих ваз або скляних бокалів;
- квіти: альстромерії, тюльпани, жовте троянди;
- зелень: орегано, розмарин;
- додаткові деталі: кришталеві кульки або маленькі свічки.
